import React from 'react';
import './App.css';
import Particles from 'react-particles-js';
import logo from './assets/logo.png'
import About from './About.js'

const particleParams = {
  particles: {
          number: {
              value: 100,
              density: {
                  enable: true,
                  value_area: 1500
              }
          },
          line_linked: {
              enable: true,
              opacity: 0.035
          },
          move: {
              direction: "right",
              speed: 0.05
          },
          size: {
              value: 1
          },
          opacity: {
              anim: {
                  enable: true,
                  speed: 1.5,
                  opacity_min: 0.05
              }
          }
      },
      interactivity: {
          events: {
              onhover: {
                  enable: true,
                  mode: "repulse"
              }
          },
          modes: {
              repulse: {
                  distance: 30
              }
          }
      },
      retina_detect: true
}

function App() {
  return (
    <>
      <div className = "divStyle">
        <div className = "h2divStyle">
          <h2 className = "h2Style">SKILLS</h2>
        </div>
        <div className = "h2divStyle">
          <h2 className = "h2Style">CONTACT</h2>
        </div>
        <div className = "h2divStyle">
          <img className = "logo" src = {logo}/>
        </div>
        <div className = "h2divStyle">
          <h2 className = "h2Style">PROJECTS</h2>
        </div>
        <div className = "h2divStyle">
          <h2 className = "h2Style">ART</h2>
        </div>
      </div>
      <About/>
      <Particles params = {particleParams}/>
    </>

  );
}

export default App;
